INSERT INTO `category_description` (`category_id`, `language_id`, `name`, `description`, `meta_keywords`, `meta_description`, `meta_title`) VALUES ('3', '1', 'Latest', '<p>Latest Products to be added. These will only be displayed on the Home Page</p>', '', '', '');
