INSERT INTO `category_description` (`category_id`, `language_id`, `name`, `description`, `meta_keywords`, `meta_description`, `meta_title`) VALUES ('2', '1', 'Featured', '<p>Featured Products. These will only be displayed on the Home Page.<br>\r\nYou can select as many items as you want, but only the amount set in admin <br>\r\nwill be display. If the amount is greater than admin limit, the items are randomly<br>\r\nselected.</p>', '', '', '');
INSERT INTO `category_description` (`category_id`, `language_id`, `name`, `description`, `meta_keywords`, `meta_description`, `meta_title`) VALUES ('10', '1', 'Related Products', '<p>Related Products: These products are items specified by the selected product.<br>\r\nThey are only displayed on Product Page in Right Side bar.<br>\r\nYou can select as many items as you want, but only the amount set in admin <br>\r\nwill be display. If the amount is greater than admin limit, the items are randomly<br>\r\nselected.</p>', '', '', '');
INSERT INTO `category_description` (`category_id`, `language_id`, `name`, `description`, `meta_keywords`, `meta_description`, `meta_title`) VALUES ('7', '1', 'Specials', '<p>Products on Special: These products are Special Priced items.<br>\r\nThey are displayed on Home, Category and Product Pages in the Right Side bar.<br>\r\nIf Related Items are available for a product, Specials are not displayed on Product page.<br>\r\nYou can select as many items as you want, but only the amount set in admin <br>\r\nwill be display. If the amount is greater than admin limit, the items are randomly<br>\r\nselected.</p>', '', '', '');
INSERT INTO `category_description` (`category_id`, `language_id`, `name`, `description`, `meta_keywords`, `meta_description`, `meta_title`) VALUES ('4', '1', 'Specials', '<p>Products on Special: These products are Special Priced items.<br>\r\nThey are displayed on Home, Category and Product Pages in the Right Side bar.<br>\r\nIf Related Items are available for a product, Specials are not displayed on Product page.<br>\r\nYou can select as many items as you want, but only the amount set in admin <br>\r\nwill be display. If the amount is greater than admin limit, the items are randomly<br>\r\nselected.</p>', 'specials, category', 'Category for products on special', 'Products on special');
INSERT INTO `category_description` (`category_id`, `language_id`, `name`, `description`, `meta_keywords`, `meta_description`, `meta_title`) VALUES ('5', '1', 'Featured', '<p>Featured Products. These will only be displayed on the Home Page.<br>\r\nYou can select as many items as you want, but only the amount set in admin <br>\r\nwill be display. If the amount is greater than admin limit, the items are randomly<br>\r\nselected.</p>', '', '', '');
