INSERT INTO `information_description` (`information_id`, `language_id`, `title`, `description`) VALUES ('2', '1', 'Privacy Policy', '<p><strong><span class="c2"><span class="c1">** Your Store ** Website Privacy Statement</span></span></strong></p>\r\n<p class="c3">This document was last updated on January 18, 2009, 11:23 am.</p>\r\n<p><strong><span class="c1">1. Acknowledgement and acceptance of terms</span></strong></p>\r\n<p class="c3">** Your Store ** is committed to protecting your privacy. This Privacy Statement sets forth our current privacy practices with regard to the information we collect when you or your computer interact with our website. By accessing <a href="../../../../../">**Your Store ** / www.yourstore.com</a>, you acknowledge and fully understand ** Your Store\'s ** Privacy Statement and freely consent to the information collection and use practices described in this Website Privacy Statement.</p>\r\n<p><strong><span class="c1">2. Participating Merchant Policies</span></strong></p>\r\n<p class="c3">Related services and offerings with links from this website, including vendor sites, have their own privacy statements that can be viewed by clicking on the corresponding links within each respective website. Online merchants and others who participate in ** Your Store\'s ** services are encouraged to participate in industry privacy initiatives and to take a responsible attitude towards consumer privacy. However, since we do not have direct control over the policies or practices of participating merchants and other third parties, we are not responsible for the privacy practices or contents of those sites. We recommend and encourage that you always review the privacy policies of merchants and other third parties before you provide any personal information or complete any transaction with such parties.</p>\r\n<p><strong><span class="c1">3. Information We Collect and How We Use It</span></strong></p>\r\n<p class="c3">** Your Store ** collects certain information from and about its users three ways: directly from our Web Server logs, the user, and with Cookies.</p>\r\n<blockquote> <blockquote>\r\n<p><strong><span class="c1">Web Server Logs</span></strong><span class="c1">.</span></p>\r\n</blockquote>\r\n<p class="c3">When you visit our Website, we may track information to administer the site and analyze its usage. Examples of information we may track include:</p>\r\n<blockquote>\r\n<p class="c3"><span class="c4">?</span> Your Internet protocol address.</p>\r\n<p class="c3"><span class="c4">?</span> The kind of browser or computer you use.</p>\r\n<p class="c3"><span class="c4">?</span> Number of links you click within the site.</p>\r\n<p class="c3"><span class="c4">?</span> State or country from which you accessed the site.</p>\r\n<p class="c3"><span class="c4">?</span> Date and time of your visit.</p>\r\n<p class="c3"><span class="c4">?</span> Name of your Internet service provider.</p>\r\n<p class="c3"><span class="c4">?</span> Web page you linked to our site from.</p>\r\n<p class="c3"><span class="c4">?</span> Pages you viewed on the site.</p>\r\n</blockquote> </blockquote>\r\n<p><strong><span class="c1">b. Use of Cookies</span></strong></p>\r\n<p class="c3">** Your Store ** may use cookies to personalize or enhance your user experience. A cookie is a small text file that is placed on your hard disk by a Web page server. Cookies cannot be used to run programs or deliver viruses to your computer. Cookies are uniquely assigned to you, and can only be read by a Web Server in the domain that issued the cookie to you.</p>\r\n<p class="c3">One of the primary purposes of cookies is to provide a convenience feature to save you time. For example, if you personalize a web page, or navigate within a site, a cookie helps the site to recall your specific information on subsequent visits. Hence, this simplifies the process of delivering relevant content and eases site navigation by providing and saving your preferences and login information as well as providing personalized functionality..</p>\r\n<p class="c3">** Your Store ** reserves the right to share aggregated site statistics with partner companies, but does not allow other companies to place cookies on our website unless there is a temporary, overriding customer value (such as merging into ** yourstore.com ** a site that relies on third-party cookies).</p>\r\n<p class="c3">You have the ability to accept or decline cookies. Most Web browsers automatically accept cookies, but you can usually modify your browser setting to decline cookies. If you reject cookies by changing your browser settings then be aware that this may disable some of the functionality on our Website.</p>\r\n<blockquote> <blockquote>\r\n<p class="c3">Personal Information Users</p>\r\n</blockquote> </blockquote>\r\n<p class="c3">Visitors to our website can register to purchase services. When you register, we will request some personal information such as name, address, email, telephone number or facsimile number, account number and other relevant information. If you are purchasing a service, we will request financial information. Any financial information we collect is used only to bill you for the services you purchased. If you purchase by credit card, this information may be forwarded to your credit card provider. For other types of registrations, we will ask for the relevant information. You may also be asked to disclose personal information to us so that we can provide assistance and information to you. For example, such data may be warranted in order to provide online technical support and troubleshooting.</p>\r\n<p class="c3">We will not disclose personally identifiable information we collect from you to third parties without your permission except to the extent necessary including:</p>\r\n<blockquote> <blockquote>\r\n<p class="c3">To fulfill your service requests for services.</p>\r\n<p class="c3">To protect ourselves from liability,</p>\r\n<p class="c3">To respond to legal process or comply with law, or</p>\r\n<p class="c3">In connection with a merger, acquisition, or liquidation of the company.</p>\r\n</blockquote> </blockquote>\r\n<p><strong><span class="c1">4. Use of Web Beacons or GIF files</span></strong></p>\r\n<p class="c3"><a href="../../../../../">** Your Store ** / www.yourstore.com</a> Web pages may contain electronic images known as Web beacons - sometimes also called single-pixel gifs - that allow ** Your Store ** to count users who have visited those pages and to deliver co-branded services. ** Your Store ** may include Web beacons in promotional e-mail messages or newsletters in order to determine whether messages have been opened and acted upon.</p>\r\n<p class="c3">Some of these Web beacons may be placed by third party service providers to help determine the effectiveness of our advertising campaigns or email communications. These Web beacons may be used by these service providers to place a persistent cookie on your computer. This allows the service provider to recognize your computer each time you visit certain pages or emails and compile anonymous information in relation to those page views, which in turn enables us and our service providers to learn which advertisements and emails bring you to our website and how you use the site. ** Your Store ** prohibits Web beacons from being used to collect or access your personal information.</p>\r\n<p><strong><span class="c1">5. Accessing Web Account Information</span></strong></p>\r\n<p class="c3">We will provide you with the means to ensure that personally identifiable information in your web account file is correct and current. You may review this information by contacting us by sending an email to our support attendant --sales@yourstore.com.</p>\r\n<p><strong><span class="c1">6. Changes to this Statement</span></strong></p>\r\n<p class="c3">** Your Store ** has the discretion to occasionally update this privacy statement. When we do, we will also revise the &quot;updated&quot; date at the top of this Privacy page. We encourage you to periodically review this privacy statement to stay informed about how we are helping to protect the personal information we collect. Your continued use of the service constitutes your agreement to this privacy statement and any updates.</p>\r\n<p><strong><span class="c1">7. Contacting Us</span></strong></p>\r\n<p class="c3">If you have questions regarding our Privacy Statement, its implementation, failure to adhere to this Privacy Statement and/or our general practices, please contact us. <a href="mailto:sales@yourstore.com">sales@yourstore.com</a> or send your comments to :</p>\r\n<p class="c3">** Your Store **</p>\r\n<p><strong><span class="c1">Attention: Privacy Statement Personal</span></strong></p>\r\n<pre class="c5">\r\nYour Address\r\nCity, Province, Country\r\nPost Code \r\n</pre>\r\n<p class="c3">** Your Store ** will use commercially reasonable efforts to promptly respond and resolve any problem or question.</p>');
